import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Sidebar from './Sidebar'; // The sidebar component
import Dashboard from './Dashboard'; // The main page that looks like the image
import ProjectPage from './ProjectPage'; // The project start page (like your index.html)

function App() {
  return (
    <Router>
      <div className="app-container">
        <Sidebar />
        <Switch>
          <Route path="/start-project" component={ProjectPage} />
          <Route path="/" component={Dashboard} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
